@AlbertoBagnai E infatti ad un certo punto esclama: “Meno male che c’è Cacciari!”…
Come dicevi tu, visto a che servono i Cacciari di turno?
A raccattare i delusi dalla sinistra passati dalla fase rem al dormiveglia per una punturina, così che possano riaddormentarsi profondamente. 🙄

